import { Box, Container,  } from '@chakra-ui/react'

export default function SignUp() {
  return (
    <Box>
      <Container>
      <Heading as='h2' size='2xl'>
        (2xl) In love with React & Next
      </Heading>
      </Container>
    </Box>
  )
}
